export const releaseNoticeEmail = async (requestData) => {
  console.log(requestData);
  try {
    const res = await axios.post(
      "http://localhost:8000/user/releaseNoticeEmail",
      requestData
    );
    return res.data;
  } catch (error) {
    console.error("Error : ", error);
    throw error;
  }
};
